import React from "react";

class User extends React.Component {
    el = this.props.user
    render() {
        return (<div>
            <h2>{el.Name}</h2>
            <p>{el.Decription}</p>
            <p>{el.isHappy ? 'Суета' : 'Грусть'}</p>
        </div>)
    }
}

export default User
